import React from "react";
import "./Header.css";
import "./HorizontalneListe";
import HorizontalnaLista from "./HorizontalneListe";
import LargeButton from "./LargeButton";

function Header()
{
    const fontVel = "15px";
    
    return(
        <header>
            <div className="tekst">
                <HorizontalnaLista
                    prvi={<LargeButton value="#TECH" fontSize="20px"/>}
                />
            </div>
            <div className="ikone">
                <HorizontalnaLista
                    prvi={<LargeButton value="PROFILE" fontSize={fontVel}/>}
                    drugi={<LargeButton value="CART" fontSize={fontVel}/>}
                    treci={<LargeButton value="SHOP" fontSize={fontVel}/>}
                    cetvrti={<LargeButton value="LOG OUT" fontSize={fontVel}/>}
                    style={{marginRight:2}}
                />
            </div>
        </header>
    );
}

export default Header;
